import React from "react";
import CreateNote from "./CreateNote";
import Note from "./Note";

const AppTodo = () =>{

    const addNote = () =>{

        alert("i am clicked")
    }

    return (
        <>
        <CreateNote passNote={addNote}/>
        <Note/>
        </>
    );

};

export default AppTodo;
